import homePageBackground from '../../images/background/apple-watch.jpg';
import {Button} from "../Button/Button";
import React from "react";
import './HomePage.css';

function HomePage2() {
    return (
        <div className='homepage-container'>
             <video src='/videos/ipad-air.mp4' autoPlay loop muted/>
           {/* <img src={homePageBackground} className='background'/>*/}
            <h1>DigiShop</h1>
            <p>برای رسیدن به اهدافت حواست به ابزار های مورد نیازت باشه:)</p>
            <p>تو استحقاق رسیدن به آرزو هایی که مال خودت هست رو داری</p>
            <div className='home-btns'>

                <Button className='btns'
                        buttonStyle='btn--outline'
                        buttonSize='btn--large'>ورود</Button>

                <Button className='btns'
                        buttonStyle='btn--primary'
                        buttonSize='btn--large'>عضویت
                    <i className='far -play-circle'/>
                </Button>
            </div>
        </div>
    );
}

export default HomePage2;
